import React from 'react';
import './Scorecard.css'; 

const Scorecard = ({ scores }) => {
  return (
    <div className="scorecard">
      {Object.entries(scores).map(([factor, score]) => (
        <div key={factor} className="score-item">
          <div className="factor">{factor}</div>
          <div className={`score ${score === 'Not Enough Data' ? 'no-data' : ''}`}>
            {score}
          </div>
        </div>
      ))}
    </div>
  );
};

export default Scorecard;
